pragma solidity ^0.5.0;

contract Oracle{

   address payable public provider;
   address payable public buyer;

   string public data;
   uint public lastUpdate;
   enum Status { Available, Active, Paused, Ended }
   Status status;

   string public dataType;
   string public dataFormat;

   uint public updateCost;  //ether
   uint public earned;      //ether
   uint public deposited;   //ether
   uint public updateCycle; //seconds

   constructor(
      address payable owner,
      string memory dtype,
      string memory dformat,
      uint cost,
      uint cycle
   )public{
      provider = owner;
      dataType = dtype;
      dataFormat = dformat;
      updateCost = cost;
      updateCycle = cycle;
      status = Status.Available;
      data = "";
      deposited = 0;
      earned = 0;
   }
   function takeContract() public returns(bool success){
      if(status == Status.Available){
         buyer = msg.sender;
         status = Status.Active;
         return true;
      }
      return false;
   }
   function update(string memory newData) public returns(bool success){
      if((msg.sender != provider))
         return false;
      if(now >= lastUpdate + updateCycle){
         if(deposited < updateCost)
            return false;
         deposited -= updateCost;
         earned += updateCost;
      }
      data = newData;
      lastUpdate = now;
      return true;
   }
   function request() public returns(bool success){
      if((msg.sender != buyer)||(deposited < updateCost))
         return false;
      return true;
   }
   function endSell(address proxy) public returns(bool success){
      address someuser = 0xE0Ee11BCf2775554EfD4356cD139f7b854bA6b22;

      if((msg.sender != provider))
         return false;
      if(proxy != address(0))
         address(uint160(someuser)).transfer(earned);   
      else{
         buyer.transfer(earned);
      }
      earned = 0;
      status = Status.Ended;
      return true;
   }
   function endBuy(address proxy) public returns(bool success){
      address someuser = 0xE0Ee11BCf2775554EfD4356cD139f7b854bA6b22;
      if(msg.sender != buyer)
         return false;
      if(proxy != address(0))
         address(uint160(someuser)).transfer(deposited);   
      else{
         buyer.transfer(deposited);
      }
      deposited = 0;
      status = Status.Ended;
      return true;
   }

   //Contract Mutators
   function setType(string memory dtype) public returns(bool success){
      if((msg.sender != provider)&&(deposited > 0))
         return false;
      dataType = dtype;
      return true;
   }
   function setFormat(string memory format) public returns(bool success){
      if((msg.sender != provider)&&(deposited > 0))
         return false;
      dataFormat = format;
      return true;
   }
   function setCycle(uint cycle) public returns(bool success){
      if((msg.sender != provider)&&(deposited > 0))
         return false;
      updateCycle = cycle;
      return true;
   }
   function setCost(uint cost) public returns(bool success){
      if((msg.sender != provider)&&(deposited > 0))
         return false;
      updateCost = cost;
      return true;
   }
   function deposit() public payable{
      deposited += msg.value;
   }
   function() external payable{
      deposited += msg.value;
   }

}
